import { BackendHomeStyled } from './BackendHome.styled';

const BackendHome = () => {
	return (
		<BackendHomeStyled>
			<div style={{ backgroundColor: 'black' }} />
			<div style={{ backgroundColor: 'blue' }} />
		</BackendHomeStyled>
	);
};

export default BackendHome;
